class PlayerList extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            players: [
                "Miljan",
                "Jovan",
                "Stefan",
                "Mali Peder",
                "Sovljanski",
                "Bogdan",
                "Gomboca",
                "Markov",
                "Ivan",
                "Slaven"
            ]
        };
    }
    render() {
        return (
            <div className="d-flex justify-content-center">
                {this.getPlayers()}
            </div>
        )
    }
}
export default PlayerList;
